property.code:
(function () {
  var init = function() {
    var button = $('patient-consent-continue');
    if (button) {
      button.observe('click', function(event) {
        window.location.reload();
      });
    }
  };
  (XWiki.domIsLoaded && init()) || document.observe("xwiki:dom:loaded", init);
})();

window.PhenoTips = (function (PhenoTips)
{
  var widgets = PhenoTips.widgets = PhenoTips.widgets || {};
  /* hack; otherwise loading order for push is wrong */
  var consentsModule = {
    createNew: function ()
    {
    }
  };
  require(['jquery'], function ($)
  {
    consentsModule.createNew = function ()
    {
      return {
        consentIdSuffix: "-consent-checkbox",
        classVariables: {
          consentsBlock: null,
          errorFunction: null,
          successfulLoadCallback: null,
          baseUrl: null,
          action: null
        },

        /**
         * @param callback function fired when the consent are successfully loaded and displayed
         */
        init: function (consentsBlock, action, baseUrlOrConsents, callback)
        {
          consentsBlock = $(consentsBlock);
          this.classVariables.consentsBlock = consentsBlock;
          this.classVariables.errorFunction = this.displayError(consentsBlock);
          this.classVariables.successfulLoadCallback = callback;
          this.classVariables.action = action;
          /* fixme modify */

          if (typeof baseUrlOrConsents == "string") {
            /* is a base url */
            this.classVariables.baseUrl = baseUrlOrConsents;
            this.loadConsents(baseUrlOrConsents);
          } else if ($.isArray(baseUrlOrConsents)) {
            /* is a consents array */
            this.afterLoadAttempt(baseUrlOrConsents);
          }
          /* otherwise do nothing*/
        },

        /** Loads a list of consents from a URL and executes a callback if successful. */
        loadConsents: function(baseUrl) {
          var _this = this;
          $.get(baseUrl, function (consents)
          {
            _this.afterLoadAttempt(consents);
          }).fail(_this.afterLoadAttempt)
        },

        /** Should be called in blocks of code where consents should have been present.
         * Logic to be executed once the consents are present. If the consents object is empty, or undefined or false
         * in any way, then it is assumed that an error has occurred. */
        afterLoadAttempt: function(consents) {
          if (consents && consents.length > 0) {
            this.displayConsents(this.classVariables.consentsBlock, this.classVariables.action, consents);
            /* no url to load from, means no url to post to */
            if (this.classVariables.baseUrl) {
              this.attachManagingListeners(this.classVariables.baseUrl);
            }
            if (this.classVariables.successfulLoadCallback) {
              this.classVariables.successfulLoadCallback();
            }
            var continueButton = $('#patient-consent-continue');
            continueButton.removeClass("hidden");
            this.classVariables.consentsBlock.initialized = true;
          } else {
            this.classVariables.errorFunction();
          }
          this.classVariables.consentsBlock.show();
        },

        displayConsents: function (consentsBlock, action, consents)
        {
          var consentList = consentsBlock.children(".consents");
          if (consentList.length == 0) {
            consentList = $("<ul class='consents'>");
            consentsBlock.append(consentList);
          }
          var list;
          if (action == "edit") {
            var _this = this;
            list = $.map(consents, function (consent)
            {
              return _this.displayGrantableConsent(consent);
            })
          } else if (action == "view") {
            var granted = this.filterGranted(consents);
            this.displayWarning(consentsBlock, granted);
            list = granted.map(this.displayConsentDescription);
          }
          if (list) {
            list.each(function (c)
            {
              consentList.append(c)
            });
          }
        },

        /** @return the list of ids, whose corresponding checkboxes are checked */
        listUIGranted: function(consentsBlock)
        {
          var _this = this;
          var block = consentsBlock;
          if (!block) {
            block = this.classVariables.consentsBlock;
          }
          var checked = block.find("input[type=checkbox]").filter(function(i, ch){
            return $(ch).is(":checked")
          });
          return checked.map(function(i, ch) {
            var id = $(ch).attr("id");
            return id.replace(_this.consentIdSuffix, "");
          }).get();
        },

        attachManagingListeners: function (baseUrl)
        {
          var _this = this;
          var consentList = $(".consents");
          consentList.on("change", "li input", function (event)
          {
            var checkbox = $(event.target);
            var rest = _this.interactWithManagingRest(checkbox.attr("data-bind"), baseUrl);
            if (checkbox.is(":checked")) {
              rest("grant");
            } else {
              rest("revoke");
            }
          })
        },

        interactWithManagingRest: function (consentId, baseUrl)
        {
          var _this = this;
          return function (action)
          {
            var url = baseUrl + action;
            $.ajax(url, {data: consentId, dataType: "text", method: "PUT", contentType: "text/plain;charset=UTF-8"})
              .fail(_this.classVariables.errorFunction);
          }
        },

        filterGranted: function (consents)
        {
          return consents.filter(function (c)
          {
            return c.status == "yes";
          })
        },

        /* Display util functions */

        displayConsentDescription: function (consent)
        {
          return $("<li>" + consent.description + "</li>");
        },

        displayGrantableConsent: function (consent)
        {
          var checkbox = $("<input type='checkbox'>")
            .attr("id", consent.id + this.consentIdSuffix)
            .attr("data-bind", consent.id);
          if (consent.status == "yes") {
            checkbox.attr("checked", "checked");
          }
          var label = "<label></label>";
          return this.displayConsentDescription(consent).prepend(checkbox).wrapInner(label);
        },

        displayWarning: function (consentsBlock, grantedConsents)
        {
          if (grantedConsents.length == 0) {
            consentsBlock.children('.warning-no-consents').removeClass('hidden');
          }
        },

        displayError: function (consentsBlock)
        {
          /* used only in the standard implementation (on the patient sheet) */
          var continueButton = $('#patient-consent-continue');
          return function ()
          {
            var errorBlock = consentsBlock.children(".error");
            continueButton.hide();
            errorBlock.removeClass("hidden");
          }
        }
      }
    };

    $(document).ready(function ()
    {
      var consentsBlock = $('#consents-block');
      if (consentsBlock.length == 1 && !consentsBlock[0].initialized) {
        var action = consentsBlock.attr("class");
        var baseUrl = consentsBlock.attr("data-url");

        consentsModule.createNew().init(consentsBlock, action, baseUrl, function ()
        {
          insertInfo(consentsBlock, action)
        });
      }
    });

    /* Display hack, the real way around this problem is to allow for descriptions in Consents API or to make the
     following part of the description of the real consent (which can cause problems, given that the document
     link will be valid only locally). */
    function insertInfo(consentsBlock, action)
    {
      if (action == "edit") {
        var consentList = consentsBlock.children(".consents");
        var info = consentsBlock.children(".consent-form-label");
        var realBullet = consentList.find("#real-consent-checkbox");
        if (realBullet.length > 0) {
          realBullet.parent().after(info);
          info.removeClass("hidden");
        }
      }
    }
  });

  widgets.ConsentsModule = consentsModule;
  return PhenoTips;
})(window.PhenoTips || {});

